        if (secondsLeft <= 0) {
          var randomLink = links[Math.floor(Math.random() * 2)];
          window.location.href = randomLink;
        } else {
          countdownElement.textContent = secondsLeft;
        }
      }, 1000);
    </script>
  </body>
</html>
